import React from "react";

const Feedback = () => {
  return (
    <div
      style={{
        width: "100%",
        height: "500px",
        textAlign: "center",
        marginTop: "100px",
        fontStyle: "italic",
      }}
    >
      <h2>Thanks For Feedback !!!</h2>
    </div>
  );
};

export default Feedback;
